 255, 255);">Deze flamenco schoentjes oftewel prinsessenschoentjes met hakje hebben een</span><br style="font-family: Arial, Helvetica, sans-serif; font-size: 13px;"><span style="font-family: Arial, Helvetica, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);">bijpassende bloem broche haarspeld. Deze bloem broche haarspeld is gemaakt</span><br style="font-family: Arial, Helvetica, sans-serif; font-size: 13px;"><span style="font-family: Arial, Helvetica, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);">van hetzelfde materiaal in dezelfde kleur als het schoentje en kan zowel in het</span><br style="font-family: Arial, Helvetica, sans-serif; font-size: 13px;"><span style="font-family: Arial, Helvetica, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);">haar als gespeld op een jasje/truitje gedragen worden.</span><br style="font-family: Arial, Helvetica, sans-serif; font-size: 13px;"><br style="font-family: Arial, Helvetica, sans-serif; font-size: 13px;"><span style="font-family: Arial, Helvetica, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);">Dit zijn echt bodemprijzen!!!</span><br style="font-family: Arial, Helvetica, sans-serif; font-size: 13px;"><span style="font-family: Arial, Helvetica, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);">Passen kan op afspraak</span>')
